import React, { useState } from "react";


function App() {


    const[time,setTime]=useState(new Date().toLocaleTimeString());

    const IncNum = () => {
        setTime(new Date().toLocaleTimeString());
    };

    return (
        <>
          <h1>{time}</h1>
          <button onClick={IncNum}>Click Me</button> 
        </>

    );
}

export default App;
